import React from 'react';
import '../../App.css';

export default class SignUp extends React.Component {

  render() {
  return (
  <div className='sign-up'>
    <form>
    <h6>SIGN UP</h6>
      <label id="icon" for="Username"><i class="fas fa-user"></i></label>
      <input type='text' class="form-control" placeholder="Username" aria-label="Username" required/>
      <br />
      <label id="icon" for="Email"><i class="fas fa-envelope"></i></label>
      <input type='text' class="form-control" placeholder="Email" aria-label="Email" required/>
      <br />
      <label id="icon" for="Password"><i class="fas fa-unlock-alt"></i></label>
      <input type='text' class="form-control" placeholder="Password" aria-label="Password" required/>
      <div class="btn-block">
          <p>By clicking Register, you agree on our <a href="https://www.w3docs.com/privacy-policy">Privacy Policy for W3Docs</a>.</p>
          <button type="submit" href="/">Submit</button>
        </div>
    </form>
  </div>
  );
}
}
